INSERT INTO cbt_soal VALUES("214","SMK3","BING-001","","3","","Salah satu penyebab terjadinya perbedaan saldo kas suatu perusahaan dengan saldo rekening Koran dari banknya adalah cek yang diterima dari debitur sebesar Rp. 5.000.000,00 dan telah disetor ke bank oleh bank di tolak karena dananya kurang. jurnal penyesuaian yang dibuat adalah …","1.mp3","","","Piutang dagang Rp. 5.000.000 Kas Rp. 5.000.000","Kas Rp. 5.000.000 Piutang dagang Rp. 5.000.000","Piutang dagang Rp. 5.000.000 Penjualan Rp. 5.000.000","Kas Rp. 5.000.000 Penjualan Rp. 5.000.000","Piutang dagang Rp. 5.000.000 Rekening koran Rp. 5000.000","","","","","","1","0");
